def get_radius_2(dir_x, dir_y, original_img, core, pre_radius, idx, Stroke):
    # 备案2 —— 按照轨迹方向确定半径
    # 这种方法较为冒险，可能会出现笔画崩溃的现象，但是它有良好的覆盖性
    # 这里改良一下，这个算法依然无法很好地解决笔画交点的错乱现象
    # 交点往往是文字骨架的交界处，这里在判断半径之前判断一下目标点的领域内有无其他笔画的骨架，如果有的话就保持之前的半径操作
    """
    :param item: 当前点
    :param dir_x: 方向
    :param dir_y: 方向
    :param original_img: 原始图片
    :param core: 圆心
    :param pre_radius: 之前的半径
    :param idx: 当前笔画
    :param Stroke: 整个笔画码
    :return: 返回半径大小
    """
    for i in range(len(Stroke)):
        if i == idx:
            continue
        this_stroke = Stroke[i]
        for pixel in this_stroke:
            if abs(core[0] - pixel[0]) <= 2 or abs(core[1] - pixel[1]) <= 2:
                return pre_radius

    radius_x = 0
    radius_y = 0
    iter_x, iter_y = core
    # 开始计算半径
    if dir_y == 0:
        # 寻找 y = 0 这条线
        # 先找左边
        while original_img[iter_x][iter_y] == 0:
            radius_x += 1
            iter_y -= 1
        iter_x, iter_y = core
        # 再找右边
        while original_img[iter_x][iter_y] == 0:
            radius_y += 1
            iter_y += 1
    elif dir_x == 0:
        # 寻找 x = 0 这条线
        # 先找上边
        while original_img[iter_x, iter_y] == 0:
            radius_x += 1
            iter_x -= 1
        iter_x, iter_y = core
        # 再找下边
        while original_img[iter_x, iter_y] == 0:
            radius_y += 1
            iter_x += 1
    elif dir_x * dir_y == -1:
        # 寻找 x + y = 0 这条线
        while original_img[iter_x, iter_y] == 0:
            radius_x += 1
            iter_x -= 1
            iter_y -= 1
        radius_x = int(radius_x * 1.5)
        iter_x, iter_y = core
        while original_img[iter_x, iter_y] == 0:
            radius_y += 1
            iter_x += 1
            iter_y += 1
        radius_y = int(radius_y * 1.5)
    else:
        # 寻找x - y = 0 这条边
        while original_img[iter_x, iter_y] == 0:
            radius_x += 1
            iter_x -= 1
            iter_y += 1
        radius_x = int(radius_x * 1.5)
        iter_x, iter_y = core
        while original_img[iter_x, iter_y] == 0:
            radius_y += 1
            iter_x += 1
            iter_y -= 1
        radius_y = int(radius_x * 1.5)
    radius = min(radius_x, radius_y)
    # if dir_x * dir_y:
    #     radius = round(radius * 1.4142135623730951)
    if radius - pre_radius >= 2:
        # 判断笔画是否出现崩溃现象
        radius = pre_radius
    return radius


