def generate_fps_maobi(template_img, original_img, Stroke, Save_dir):
    """
    :param Save_dir: 保存的地址
    :param template_img: 空白模板
    :param original_img: 原图
    :param Stroke: 笔画
    :return:
    """
    # 用来存储图片编号的，以便接下来合成视频
    """
            这里整理一下(dir_x, dir_y)的取值对八邻域的关系
            (dir_x, dir_y) == (0, 1) 或者 (0, -1) 则半径的选取为 x = 0 这条直线
            (dir_x, dir_y) == (1, 0) 或者 (-1, 0) 则半径的选取为 y = 0 这条直线
            (dir_x, dir_y) == (1, 1) 或者 (-1, -1) 则半径的选取为 y = x 这条直线
            (dir_x, dir_y) == (1, -1) 或者 (-1, 1) 则半径的选取为 y = -x 这条直线
            半径的长度如此定义 -> 沿着直线寻找两个端点，寻找最近的一个端点距离圆心的位移距离作为这个圆的半径
    """
    if os.path.exists(Save_dir):
        shutil.rmtree(Save_dir)
    os.mkdir(Save_dir)
    cnt = 0
    iter_img = template_img.copy()

    # 广度优先遍历队列
    q = queue.Queue()
    dx = [1, -1, 0, 0]
    dy = [0, 0, -1, 1]
    radius = 0
    stroke_number = 0
    for item in Stroke:
        style = -1
        # 在这个地方判断这个笔画是什么？然后把毛笔贴上去
        small = np.zeros(7, dtype=int)
        for i in range(1, len(item)):
            # 骨架顺序
            # 第一笔是竖
            # 第二笔是捺
            # 第三笔是右横
            # 第四笔是撇
            # 第五笔是左横
            # 第六笔是提
            # 第七笔是向上提
            # 缩放百分比
            py = item[i][1] - item[i - 1][1]
            px = item[i][0] - item[i - 1][0]
            if px == 0:
                if py == 1:
                    small[3 - 1] += 1
                else:
                    small[5 - 1] += 1
            elif py == 0:
                if px > 0:
                    small[1 - 1] += 1
                else:
                    small[7 - 1] += 1
            elif px * py == 1:
                small[2 - 1] += 1
            else:
                if py > 0:
                    small[6 - 1] += 1
                else:
                    small[4 - 1] += 1
        k = 0
        for i in range(0, 7):
            if k < small[i]:
                k = small[i]
                style = i + 1
        for i in range(len(item)):
            item[i][2] = style

        for i in range(len(item)):
            print(f"笔画方向{item[i][2]}")
            visit_map = np.zeros_like(original_img, dtype=bool)
            # radius = get_radius_1(original_img, item[i])
            if i == 0:
                radius = get_radius_1(original_img, item[i])
            else:
                dir_x, dir_y = item[i][0] - item[i - 1][0], item[i][1] - item[i - 1][1]
                radius = get_radius_2(dir_x, dir_y, original_img, item[i], radius, stroke_number, Stroke)
                # 这里添加毛笔

            print(f"圆心：({item[i][0]}, {item[i][1]}), 半径: {radius}")
            # 开始分帧
            cnt += 1
            # 接下来的问题是，确定了圆心和半径，如何绘制圆
            # 一种妥协的方式： 广度优先搜索， 时间复杂度较低
            # print(item[i])
            q.put(item[i])
            visit_map[item[i][0], item[i][1]] = True
            while not q.empty():
                now = q.get()
                now_x, now_y = now[0], now[1]
                # distance = round(math.sqrt(pow(now_x - item[i][0], 2) + pow(now_y - item[i][1], 2)))
                # if distance > radius:
                #     continue
                iter_img[now_x, now_y] = (0, 0, 0)
                for j in range(4):
                    next_x = now_x + dx[j]
                    next_y = now_y + dy[j]
                    if original_img[next_x, next_y] == 255 or visit_map[next_x, next_y] or \
                            round(math.sqrt(pow(next_x - item[i][0], 2) + pow(next_y - item[i][1], 2))) > radius:
                        continue
                    q.put((next_x, next_y))
                    visit_map[next_x, next_y] = True
            maobi = cv2.imread(f"image/{style}.jpg", cv2.IMREAD_UNCHANGED)
            delta_x = 0
            delta_y = 0
            padding = 40
            if style == 1:
                maobi = cv2.resize(maobi, (16, padding))
                delta_x = -16 // 2
            elif style == 2:
                maobi = cv2.resize(maobi, (padding, padding))
            elif style == 3:
                maobi = cv2.resize(maobi, (padding, padding))
                delta_y = -padding
            elif style == 4:
                maobi = cv2.resize(maobi, (padding, padding))
                delta_x = -padding
            elif style == 5:
                maobi = cv2.resize(maobi, (padding, 16))
                delta_x = -padding
                delta_y = -16 // 2
            elif style == 6:
                maobi = cv2.resize(maobi, (padding, padding))
                delta_y -= padding
            else:
                maobi = cv2.resize(maobi, (16, padding))
                delta_x = -16 // 2
                delta_y -= padding

            ret_img = iter_img
            ret_img = cv2.copyMakeBorder(ret_img, padding, padding, padding, padding, cv2.BORDER_CONSTANT, value=[220, 245, 245])
            x = item[i][1] + delta_x + padding  # 图片左上角的x坐标
            y = item[i][0] + delta_y + padding  # 图片左上角的y坐标
            image_height, image_width, _ = maobi.shape
            # 确定图片在视频中的 ROI
            roi = ret_img[y:y + image_height, x:x + image_width]

            # 从图片中提取透明度通道
            alpha_channel = maobi[:, :, 3] / 255.0

            # 将图片叠加到视频帧上
            for c in range(0, 3):
                roi[:, :, c] = alpha_channel * maobi[:, :, c] + (1 - alpha_channel) * roi[:, :, c]

            # # 将帧写入输出视频
            cv2.imshow("image", ret_img)
            print(ret_img.shape)
            cv2.waitKey(1)
            cv2.imwrite(Save_dir + "/" + f"{cnt}.jpg", ret_img)

        stroke_number += 1


def Generate_Video(fps_folder, video_folder):
    """
    :param fps_folder: 保存 fps 的文件夹
    :param video_folder: 保存 视频 的文件夹
    :param gif_folder: 保存 gif 的文件夹
    :param Picture: 视频名字
    :return: 返回视频
    """
    frames = os.listdir(fps_folder)
    frames.sort(key=lambda x: int(x.split('.')[0]))
    # 提取视频分辨率
    rows, cols = cv2.imread(fps_folder + "/1.jpg").shape[0], cv2.imread(fps_folder + "/1.jpg").shape[1]
    # 下面是生成GIF的代码

    # 下面是生成MP4的代码
    # 设置 帧数
    fps = 40

    # 设置生成视频的名字
    video_name = "output"
    video_dir = os.path.join(video_folder, video_name + ".mp4")
    if os.path.exists(video_dir):
        os.remove(video_dir)
    fourcc = cv2.VideoWriter.fourcc(*'H264')
    VideoWriter = cv2.VideoWriter(video_dir, fourcc, fps, (cols, rows))

    for frame in frames:
        f_path = os.path.join(fps_folder, frame)
        image = cv2.imread(f_path)
        VideoWriter.write(image)
    VideoWriter.release()


